import React from 'react';

export function Square(props) {
  return (
    <button className="square" onClick={props.onClick}>
      {props.value}
    </button>
  );
}

const styles = {
  rectangle: {
      width: '50px',
      height: '50px',
      margin: '10px',
      backgroundColor: "#338",
      transform: 'rotate(45deg)',
  },
  cont_row: {
    display: "flex",
    flexDirection: "row",
  },
  bruh: {
    position: 'absolute',
    width: '350px',
    height: '350px',
    margin: '35px',
    backgroundColor: "#333",
  },
  check: {
    height: "50px",
     width: "50px",
     backgroundColor: "#555",
     borderRadius: "50%",
  }
}
